import React from 'react';
import {
  FaTh,
}from "react-icons-fa";

import './SideBar.css'

const SideBar = () => {
  const menuItem=[{
    path:"/",
    name:"DashBoard",
    icon:<FaTh/>
  },
  {
  path:"/createreport",
  name:"CreateReport",
  icon:<FaRegChartBar/>
  },
  {
  path:"/viewtool",
  name:"ViewTool",
  icon:<FaCommentAlt/>
  }
]
  return (
    <div>
    <h1>This is sidebar</h1>
    </div>
  )
}

export default SideBar
